import './App.css';
import React from 'react';
import ReactDOM from 'react-dom/client';

function App() {
  return (
    <div className="App">
      <h1 className="App-header">Student Enrollment Form</h1>
    </div>
    );
}


function MyForm() {
  return (
    <form class>
      <label>Enter your name:
        <input type="text" />
      </label>
    </form>
  )
}



export default App;
